import React,
      { Component } from 'react';
import { Link } from 'react-router-dom';

class ListOpenedPositions extends Component {

  constructor( props )
  {

    super(props);

  }

  processSector( sector )
  {

    return (
      <div>
        <label data-label-carrer>{ sector.sector }</label>

        {
          sector.positions.map( ( position ) => {

            return (
              <div data-content-job>
                <p data-title>{ position.title }</p>
                <p data-location>{ position.location }</p>
              </div>
            );

          })
        }
      </div>
    );

  }

  render() {

    let self          = this;
    var { positions } = this.props;

    let content_positions = positions.map( ( sector ) => {
      return self.processSector( sector );
    } )

    return (

      <div className="container-page">
        { content_positions }
      </div>
    );
  }
}
export default ListOpenedPositions;
